import React, { Component, useState } from 'react';
import TodoSubList from './todosublist'
import "../App.css"
import Grid from '@material-ui/core/Grid'
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    root: {
        border: "5px solid black",
    }
})

const TodoList = (props) => {
    const classes = useStyles()
    //set up state from app.js

    //Lets return a div with ul with what is inside the state

    let mapper =
        <div className="container">
            {
                props.map(input =>
                    <div className="container">
                        <div className="item1">{input.task}</div>
                        <div className='item1'>{input.dateB}</div>
                        <div className="item1">{input.dateE}</div>
                        <div className='item1'>{input.completed}</div>
                    </div>
                )
            }


        </div>


    let content = (
        <div>
            <ul>
                {mapper}
            </ul>
        </div>
    )
    return content
}


export default TodoList;
